import React, { Component } from "react";
import Axios from "axios";
import DatePicker from "./datePicker";
import Button from "./button";
import Pagination from "./common/pagination";
import { paginate } from "../utils/paginate";

class RealTime extends Component {
  state = {
    jobs: [],
    message: [],
    text: "Play",
    currentPage: 1,
    pageSize: 150,
  };

  capture = {
    jobName: "",
    startTime: 0,
    endTime: 0,
  };

  changeText = (text) => {
    this.setState({ text });
  };

  async componentDidMount() {
    const { data: jobs } = await Axios.get(
      "http://ec2-54-152-230-158.compute-1.amazonaws.com:7999/api/play"
    );

    this.setState({ jobs });
  }

  handlePageChange = (page) => {
    this.setState({ currentPage: page });
  };

  render() {
    const { length: count } = this.state.jobs;
    const { text } = this.state;

    const jobs = paginate(
      this.state.jobs,
      this.state.currentPage,
      this.state.pageSize
    );

    if (count === 0) return <p>There are no job in the database.</p>;

    return (
      <React.Fragment>
        <iframe style="width: 200px; height: 200px;">
          <div class="container">
            <div class="row-fluid">
              <table> </table>
            </div>
          </div>
        </iframe>
      </React.Fragment>
    );
  }
}

export default RealTime;
